    onButtonClick4: function(button, e, eOpts) {
        var combinationSelectionPanel = this.down('#combinationSelectionPanel');
        var store = combinationSelectionPanel.getStore();

        var nameField = this.down('#combinationName');
        var name = nameField.getValue();

        var priorityField = this.down('#combinationPriority');
        var priority = priorityField.getValue();

        var typeCombo = this.down('#combinationType');
        var type = typeCombo.getValue();

        var resultPanel = this.down('#configurationResultPanel');
        resultPanel.store.getProxy().url = 'service/CreateCombination';


        var listRecord = null;  
        if(store instanceof Ext.data.Store){  
            listRecord = [];
            store.each(function(record){  
                listRecord.push(record.data);  
            });  
        }else if(store instanceof Array){  

            listRecord = [];  
            Ext.each(store,function(record){  
                listRecord.push(record.data);  
            });  
        }  
        var list = Ext.encode(listRecord); 


        resultPanel.store.load({params:{'type':type,'priority':priority,'name':name,'list':list}});


        combinationSelectionPanel.store.removeAll();
    },

